import React from 'react';
import { useNavigate } from 'react-router-dom';
import useProfileStore from '../../store/profileStore';
import './TeamsWithProposalPage.css'; // Reuse RoomPage.css with additions

const TeamsWithProposalPage = () => {
  const navigate = useNavigate();
  const { teamsWithProposals } = useProfileStore();

  return (
    <div className="room-page"> {/* Match RoomPage container */}
      <div className="room-header">
        <div className="header-content">
          <div className="room-info">
            <h1>Research Teams with Proposals</h1>
            <p className="creator-info">
              {teamsWithProposals.length} {teamsWithProposals.length === 1 ? 'team' : 'teams'} with proposals
            </p>
          </div>
          <div className="header-actions">
            <button 
              onClick={() => navigate('/')} 
              className="secondary-button"
            >
              ‚Üê Back to Home
            </button>
          </div>
        </div>
      </div>

      <div className="content-container">
        {teamsWithProposals.length === 0 ? (
          <div className="empty-state">
            <div className="empty-icon">
              <span role="img" aria-label="Research">üìë</span>
            </div>
            <h3>No Teams with Proposals</h3>
            <p>Generate teams and proposals to view them here</p>
            <button 
              onClick={() => navigate('/teams')} 
              className="primary-button"
            >
              Go to Teams
            </button>
          </div>
        ) : (
          <div className="teams-proposals-grid"> {/* New layout */}
            {teamsWithProposals.map((team) => (
              <div key={team.team_id} className="team-proposal-card">
                {/* Left Panel - Team Info */}
                <div className="team-info-panel">
                  <div className="card-header">
                    <h3>Team {team.team_id}</h3>
                    <span className="email-badge">
                      {team.team_size} member{team.team_size !== 1 ? 's' : ''}
                    </span>
                  </div>

                  <div className="card-section">
                    <h4 className="section-title">Research Focus:</h4>
                    <div className="topics-container">
                      {team.team_research_areas.map((area, idx) => (
                        <span key={idx} className="topic-tag">{area}</span>
                      ))}
                    </div>
                  </div>

                  <div className="card-section">
                    <h4 className="section-title">Members:</h4>
                    <div className="members-list">
                      {team.members.map((member, idx) => (
                        <div key={idx} className="member-item">
                          <div className="member-name">{member}</div>
                          <div className="member-topics">
                            {team.member_fields[member].map((field, i) => (
                              <span key={i} className="field-tag">{field}</span>
                            ))}
                          </div>
                        </div>
                      ))}
                    </div>
                  </div>
                </div>

                {/* Right Panel - Proposal */}
                <div className="proposal-panel">
                  <div className="proposal-header">
                    <h3>Project Proposal</h3>
                    <span className="score-badge">
                      Score: {team.proposal_score || 'N/A'}
                    </span>
                  </div>

                  <div className="proposal-content">
                    <h4 className="section-title">Title:</h4>
                    <p className="proposal-title">{team.proposal_title || 'Untitled Proposal'}</p>

                    <h4 className="section-title">Description:</h4>
                    <div className="proposal-description">
                      {team.proposal_description || 'No description available'}
                    </div>

                    <h4 className="section-title">Key Points:</h4>
                    <ul className="proposal-points">
                      {team.proposal_key_points?.map((point, idx) => (
                        <li key={idx}>{point}</li>
                      )) || <li>No key points generated</li>}
                    </ul>
                  </div>
                </div>
              </div>
            ))}
          </div>
        )}
      </div>
    </div>
  );
};

export default TeamsWithProposalPage;
